            __builder.AddMarkupContent(2, "<h1> Unsere Technologien</h1>\r\n");
            __builder.AddMarkupContent(3, "<section>\r\n    <h4>Simulation & Erprobung</h4>\r\n\r\n    <p>\r\n        Simulation und Erprobung gehen bei uns Hand in Hand.\r\n\r\n        Unsere Wentwicklungsingenieure nutzen von Anfang an due Vorteile der numerischen Simulation\r\n        und tauschen dabei sich ständig mit unseren Prüf- und Versuchslaboren aus,\r\n        damit Versuchsergebnisse direkt in optimierte Prozesse einfließen können.\r\n    </p>\r\n    <img id=\"lab\" class=\"rounded float-end\" src=\"https://www.montaplast.com/fileadmin/_processed_/csm_img_9947_ccb5b2a5ae.jpg\">\r\n    <img class=\"rounded float-start\" src=\"https://www.montaplast.com/fileadmin/_processed_/csm_img_9967_ret_e237e840c6.jpg\">\r\n    <br>\r\n    <h4>Simulation</h4>\r\n    <p>\r\n\r\n        Die Produktentwickler stellen die geforderten Funktionen in Simulationen dar und suchen von Beginn an potenzielle Schwachstellen.<br>\r\n        Dass 3D-Simulationen zunehmend den Prototyp zum Anfassen ersetzen, hat Vorteile: Zeit und Entwicklungskosten werden gespart. <br>\r\n        Der Nachteil: Auch Fehlerquellen müssen simuliert und ausgeschaltet werden - aber auch darauf ist Montaplast spezialisiert,<br>\r\n        denn wir führen unter anderem folgende Analysen durch:\r\n    </p>\r\n    <table align=\"center\">\r\n        <tr><td>Rheologie (Werkzeugfüllung, Temperierung, Bauteilverzug)</td></tr>\r\n        <tr><td>Statik (Steifigkeit, Festigkeit, Hot Spots)</td></tr>\r\n        <tr><td>Dynamik (Kopfaufschlag, Fußgängerschutz, AZT)</td></tr>\r\n        <tr><td>Strömung (Akustik, Ladungswechsel, Luftfiltration, Wasserseparation)</td></tr>\r\n        <tr><td>Nutzung der Methoden der statistischen Versuchsplanung</td></tr>\r\n    </table>\r\n    <section id=\"mid\">\r\n        <h4>Erprobung</h4>\r\n        <p>\r\n            Erst Versuche an Prototypen verleihen jedem Simulationsmodell die notwendige Realität <br>\r\n            und legen die Material-, Funktions- und Lebensdauerbelastungen fest.<br>\r\n            In allen Entwicklungsstadien  prüfen wir die geforderten Eigenschaften des Produktes. <br>\r\n            Zu unserer Versuchspalette gehören unter anderem folgende Punkte<br>\r\n        </p>\r\n    </section>\r\n    <table align=\"center\">\r\n        <tr><td>Gesetzliche Anforderungen (Kopfaufschlag, Fußgängerschutz, Emissionen)</td></tr>\r\n        <tr><td>Umfeldbedingungen (Temperatur, Klima, Berstdruck, Vibration)</td></tr>\r\n        <tr><td>Funktionsprüfungen (Dauerlauf, Missbrauch, Motoren- und Fahrtests)</td></tr>\r\n        <tr><td>Akustik (Modalanalysen)</td></tr>\r\n    </table>\r\n</section>\r\n");
            __builder.AddMarkupContent(4, "<section>\r\n    <h4>Design & Engineering </h4>\r\n\r\n    <h5>Moderne Autos brauchen ganzheitliche Systemlösungen. Wir finden sie.</h5>\r\n    <p>\r\n        Automobilzulieferer - vor nicht allzu langer Zeit war das eine eher überschaubare Aufgabe.<br>\r\n        Im Fall von Montaplast bedeutete es: Wir entwarfen und produzierten hochwertige Kunststoffteile.<br>\r\n\r\n        Heute ist mehr gefragt, und so kann das System Montaplast seine Flexibilität voll ausspielen.<br>\r\n        Einen Bauraum und ein Anforderungsprofil - mehr brauchen wir nicht, um in Eigenverantwortung die optimale Systemlösung zu finden.<br>\r\n        Gilt es etwa, ein neues Ansaugrohr zu entwickeln, sorgt Montaplast auch dafür, dass alle Grundlagen zur Erfüllung der EU-Abgasnormen gelegt werden.<br>\r\n        Bei Stoßfängern oder Kotflügeln wird die Gesetzgebung zum Fußgängerschutz einbezogen. <br>\r\n        Interieurteile werden für die verschiedensten Unfallsituationen ausgelegt.<br>\r\n        Wir entwickeln, simulieren und validieren komplette Baugruppen, integrieren Zukaufteile,<br>\r\n        konzipieren Montageschritte und -vorrichtungen, konfektionieren die Module, veredeln die Oberflächen und entwickeln das passende Logistik-Konzept.<br>\r\n\r\n        All das ist heute Montaplast. Das Herz aller Systeme \"Made by Montaplast\" sind dabei nach wie vor qualitativ hochwertige Kunststoffteile.\r\n    </p>\r\n    <strong> CaD- Systeme</strong>\r\n    <table align=\"center\">\r\n\r\n        <tr><td>CATIA V4/V5</td></tr>\r\n        <tr><td>Unigraphics</td></tr>\r\n        <tr><td>I-DEAS</td></tr>\r\n        <tr><td>Pro-Engineer</td></tr>\r\n        <tr><td>AutoCAD</td></tr>\r\n    </table>\r\n</section>\r\n<br>\r\n");
