            __builder.AddMarkupContent(6, @"<section>
    <h4>Produktion aus einem Guss</h4>
    <br>
    <img src=""https://www.montaplast.com/fileadmin/media/kopfbilder/keyvisual_halter2.jpg"" class=""img-fluid"">
    <br>
    <strong>Spritzguss, Schweißen, Konfektion -hohe Innovationsbereitschat sichert Montaplast Wettbewerbsvorteile</strong>
    <p>
        ""Immer auf dem neuesten Stand der Entwicklung sein"" - diesem Leitsatz von Albert Stulz sr. folgend, <br>
        gehört Montaplast seit langem zur Weltspitze in der Spritzguss-, Schalen-, Schweiß- und Lackiertechnik.
    </p>
    <p>
        Ein Beispiel: das Schmelzkernverfahren. Die Technik, Metallkerne mit Kunststoff zu umspritzen, <br>
        entdeckten wir Mitte der 80er-Jahre in der Sportartikelindustrie und machten sie für die Serienproduktion von Porsche-Ansaugrohren nutzbar.<br>
        Das Verfahren wurde seitdem laufend perfektioniert und spielt noch heute eine wichtige Rolle bei Montaplast.<br>
        Daneben gehören Mehrkomponenten-, Funktions-, Montage-Spritzguss, hoch entwickelte Verfahren der Schalentechnik,<br>
        Gas-Innendruck- Verfahren oder das Hinterspritzen von Folie, Textil und Leder zu unserem Leistungsspektrum, <br>
        ebenso wie die Verbindung verschiedener Materialien durch Ultraschall- oder Vibrationsschweißen.<br>
    </p>

</section>
");
